import "./contact.scss"
import emailjs from "emailjs-com";
import React from 'react';


export default function Contact() {
    function sendEmail(e) {
        e.preventDefault();

    emailjs.sendForm('gmail', 'template_6flwwjm', e.target, 'user_6lvljyPRltrXndg1r5pcL')
        .then((result) => {
              console.log(result.text);
        }, (error) => {
              console.log(error.text);
        });
        e.target.reset()
    };

    return (
        <div className='contact' id="contact">
            <div className="left">
                <img src="assets/mail4.png" height="350px" className="contact"/>
            </div>
            <div className="right">
            <form onSubmit={sendEmail}>
                <div className="col-8 pt-5 mx-auto">
                    <div className="col-8 form-group mx-auto">
                        <input type="text" className="form control" placeholder ="Name" name="user_name" />
                    </div>
                    <div className="col-8 form-group mx-auto">
                        <input type="email" className="form control" placeholder ="Email adress" name="email" />
                    </div>
                    <div className="col-8 form-group mx-auto">
                        <input type="text" className="form control" placeholder ="Subject" name="subject" />
                    </div>
                    <div className="col-8 form-group mx-auto">
                        <textarea className="form control" id="" cols="30" rows="8" placeholder ="your message" name="message"></textarea>
                    </div>
                    <div className="col-8 form-group mx-auto">
                        <input type="submit" className="btn btn-info" value="Send Message"></input>
                    </div>
                </div>   
            </form>
            </div>
        </div>
    )
}
